  \"2015-11-18T09:34:23.753410\",\n\t\"name\": \"u-s-forest-service-integrated-resource-restoration-895ff\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"A map service on the www depicting activities
  funded through the Integrated Resource Restoration (IRR) NFRR Budget Line Item and
  reported through the U.S. Forest Service FACTS database. Activities funded through
  the IRR initiative include areas treated to sustain or restore watershed function;
  forestlands treated using timber sales; forestland vegetation improved, forest land
  vegetation established, rangeland vegetation improved by treatment for noxious weeds
  or invasive plants; and hazardous fuels treated outside the wildland/urban interface
  to reduce the risk of catastrophic wildland fire. It is important to note that this
  map service does not contain all activities funded through NFRR because the spatial
  portion of the activity description is not required and is self-reported by Forest
  Service units.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
